import styles from './Navigation.css';
import React from 'react';
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Typography from '@material-ui/core/Typography'
import IconButton from '@material-ui/core/IconButton'
import Button from '@material-ui/core/Button';
import {Link} from 'react-router-dom';
import Grid from '@material-ui/core/Grid';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import logo from './bd_logo.png';

const theme = createMuiTheme({
  overrides: {
    // Style sheet name ⚛️
    MuiButton: {
      color: 'red'
    },
  },
});

const Navigation = () => {
  return(
    <div>
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu">
          <img src={logo} style={{height: "50px", width: "50px", borderRadius: "200/2"}} />
          </IconButton>
          <Typography variant="h3" fontFamily='"Product Sans", serif' color="inherit">
            BREAKDOWN
          </Typography>
          <div className={styles.buttons}>
            <ThemeProvider theme={theme}>
              <Grid alignContent='stretch' container spacing={3}>
                <Grid item xs={3}>
                  <Button component={Link} to="/" color="inherit">Home</Button>
                </Grid>
                <Grid item xs={3}>
                  <Button component={Link} to="/upload" color="inherit">Upload</Button>
                </Grid>
                <Grid item xs={3}>
                  <Button component={Link} to="/trending" color="inherit">Trending</Button>
                </Grid>
                <Grid item xs={3}>
                  <Button component={Link} to="/profile" color="inherit">Profile</Button>
                </Grid>
              </Grid>
            </ThemeProvider>
          </div>
          <div className="buttons">
            <Grid container spacing={3}>
              <Grid item xs={3}>
                <Button component={Link} to="/login" color="inherit">Logout</Button>
              </Grid>
            </Grid>
          </div>
        </Toolbar>
      </AppBar>
    </div>
  )
}
export default Navigation;
